import React from 'react';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

export default function DatePickerExample() {
    return (
        <Grid 
            container 
        >
            <Grid 
                item 
                xs 
            >
                <TextField 
                    id='time-picker' 
                    label='Time' 
                    defaultValue={Date.now()}
                    type='time' 
                    InputLabelProps={{
                        shrink: true,
                    }}
                    inputProps={{
                        step: 300,
                    }} 
                />
            </Grid>
        </Grid>
    );
}
